import { React, useEffect, useState } from "react";
import axios from "axios";
const Kategorije = () => {
  useEffect(async () => {
    const result = await axios(
      "https://hn.algolia.com/api/v1/search?query=redux"
    );

    setData(result.data);
  });
  return (
    <ul id="predmeti">
      <li className="predmet">Naziv</li>
    </ul>
  );
};

export default Kategorije;
